// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract MarketStore {
  struct Product {
        string productId;
        uint quantity;
        string orderId;
        uint256 price;
        uint256 timestamp;
        string size;
        string manufacturingMaterial;
        string state;
        string sellerId;
        uint256 blockNumber; // Added field to store the block number
        bytes32 blockHash; // Added field to store the block hash
    }

    struct PointsTransaction {
        uint256 amount;
        uint256 timestamp;
        bool isAddition;
    }

    mapping(string => uint256) public loyaltyPoints;
    mapping(string => PointsTransaction[]) public pointsTransactions;
    mapping(string => mapping(string => Product[])) public userProductHistory;

    event ProductSold(
        string productId,
        uint256 quantity,
        uint256 totalPrice,
        uint256 timestamp,
        string size,
        string manufacturingMaterial,
        string state,
        string sellerId,
        string buyerId,
        uint256 blockNumber, // Added field in the event
        bytes32 blockHash // Added field in the event
    );
    event PointsAdded(string userId, uint balance);
    event PointsRemoved(string userId, uint balance);

  function sellProduct(
        string memory productId,
        uint256 quantity,
        string memory orderId,
        uint256 price,
        string memory size,
        string memory manufacturingMaterial,
        bool state,
        string memory sellerId,
        string memory buyerId
    ) public {
        uint256 timestamp = block.timestamp;
        uint256 currentBlockNumber = block.number;
        bytes32 currentBlockHash = blockhash(currentBlockNumber);

        // Create a new product entry
        Product memory newProduct = Product(productId, quantity,orderId, price, timestamp, size, manufacturingMaterial, (state)?"Running":"Cancelled", sellerId, currentBlockNumber, currentBlockHash);



        emit ProductSold(
            productId,
            quantity,
            price,
            timestamp,
            size,
            manufacturingMaterial,
            (state)?"Running":"Cancelled",
            sellerId,
            buyerId,
            currentBlockNumber,
            currentBlockHash
        );

        // Add the product to the user's product history
        userProductHistory[buyerId][productId].push(newProduct);

        (state) ? addLoyaltyPoints(quantity * price, buyerId) : removeLoyaltyPoints(quantity * price, buyerId);
    }


  // Function to add loyalty points to a user
function addLoyaltyPoints(uint256 amount, string memory userId) public {
    loyaltyPoints[userId] += amount/100;
    emit PointsAdded(userId, loyaltyPoints[userId]);

    // Add loyalty points transaction to history
    addPointsTransaction(userId, amount/100, true);
}

// Function to remove loyalty points from a user
function removeLoyaltyPoints(uint256 amount, string memory userId) public {

    loyaltyPoints[userId] -= amount/100;
    emit PointsRemoved(userId, loyaltyPoints[userId]);

    // Add loyalty points transaction to history
    addPointsTransaction(userId, amount/100, false);
}



// Function to get the loyalty points balance of a user
function getLoyaltyPoints(string memory userId) public view returns (uint256) {
    return loyaltyPoints[userId];
}

// Function to add a loyalty points transaction to the history
function addPointsTransaction(string memory userId, uint256 amount, bool isAddition) internal {
    pointsTransactions[userId].push(PointsTransaction(amount, block.timestamp, isAddition));
}

// Function to retrieve the loyalty points transaction history of a user
function getPointsTransactionHistory(string memory userId) public view returns (PointsTransaction[] memory) {
    return pointsTransactions[userId];
}

// Function to get the product history of a user
function getProductHistory(string memory userId, string memory productId) public view returns (Product[] memory) {
    Product[] storage productHistory = userProductHistory[userId][productId];
    Product[] memory extractedProductHistory = new Product[](productHistory.length);

    for (uint256 i = 0; i < productHistory.length; i++) {
        extractedProductHistory[i] = Product(
            productHistory[i].productId,
            productHistory[i].quantity,
            productHistory[i].orderId,
            productHistory[i].price,
            productHistory[i].timestamp,
            productHistory[i].size,
            productHistory[i].manufacturingMaterial,
            productHistory[i].state,
            productHistory[i].sellerId,
            productHistory[i].blockNumber,
            productHistory[i].blockHash
        );
    }

    return extractedProductHistory;
}


}
